function ExpenseDate(props) {
  const month = props.date.toLocaleString("default", { month: "short" });
  const year = props.date.getFullYear();
  const day = props.date.toLocaleString("default", { weekday: "short" });
  return (
    <div>
      <div>{month}</div>
      <div>{year}</div>
      <div>{day}</div>
    </div>
  );
}
export default ExpenseDate;
